import React from 'react';

const Services = () => {
  return (
    <div style={{ fontFamily: 'Arial, sans-serif', padding: '20px', maxWidth: '1400px', margin: '0 auto' }}>
      <h1 style={{ fontSize: '24px', color: '#333', marginBottom: '40px', textAlign: 'center' }}>Our Services</h1>

      <div style={{ display: 'flex', justifyContent: 'center', gap: '40px', flexWrap: 'nowrap' }}>
        {services.map((service, index) => (
          <img
            key={index}
            src={require(`./../../assets/${service.icon}`)}
            alt={`Service ${index + 1}`}
            style={{ maxWidth: '300px', height: 'auto', flexShrink: 1 }} // Allow shrinking if needed
          />
        ))}
      </div>
    </div>
  );
};

const services = [
  { icon: '1.png' },
  { icon: '2.png' },
  { icon: '3.png' },
];

export default Services;
